import React,{useState,useEffect} from 'react'
import PokemonList from './PokemonList'

function PokemonApp() {
    const [pokemon, setpokemon] = useState(['limber','imposter'])
    return (
        <div>
            <PokemonList pokemon={pokemon}/>
        </div>
    )
}

export default PokemonApp
